('LP101', 'Learning process', 'I often have trouble making sense of the things I have to learn.', 1, 'Learning'),
('LP102', 'Learning process', 'I put a lot of effort into my studying.', 5, 'Learning'),
('LP103', 'Learning process', 'Much of what Ive learned seems no more than unrelated bits and pieces.', 1, 'Learning'),
('LP104', 'Learning process', 'On the whole, Ive been systematic and organised in my studying.', 5, 'Learning'),
