(5, 2, 'skills', 'It sounds like you have some problems with your skills , it would be better if you could contact your school counselor for some training/development. 01. Set Clear Goals: Define what you want to achieve with these skills. Having specific goals will provide direction for your improvement journey.<br><br>02.Seek Educational Resources: Look for courses, tutorials, books, or online materials that can help you gain a better understanding of the skill you\'re looking to improve.<br><br>03.Regular Practice: Consistency is key. Dedicate time each day or week to practice and apply your skills in real-world situations.<br><br>04.Receive Feedback: Seek feedback from mentors, peers, or experts in the field. Constructive criticism can help you identify areas that need attention.<br><br>05.Track Progress: Keep a journal or use tools to monitor your progress. This will help you see how far you\'ve come and identify areas where you\'ve improved.<br><br>06.Stay Patient and Persistent: Skill development takes time, so be patient with yourself. Stay committed and don\'t get discouraged by initial setbacks.', 'promt 52'),
(5, 3, 'skills', 'It sounds like you\'re doing below average, but it doesn\'t sound like you\'re doing badly, there\'s room for improvement. 01.Set Ambitious Goals: Define clear and ambitious goals that you want to achieve with your skills. This will help you stay motivated and focused.<br><br>02.Expand Your Knowledge: Seek out advanced courses, expert advice, or additional resources to deepen your understanding of the skill.<br><br>03.Dedicated Practice: Continue practicing regularly to refine your skills. Explore different challenges or projects that push your abilities.<br><br>04.Feedback Loop: Actively seek feedback from experienced individuals in your field to identify areas for improvement. Constructive criticism is invaluable.<br><br>05.Record Your Progress: Keep track of your achievements and areas of improvement. This will help you visualize your growth.<br><br>07.Stay Consistent: Consistency in practice and learning is key to reaching the next level of proficiency.', 'promt 53'),
(5, 4, 'skills', 'You\'re doing well, you seem to be a little below avarage but in line with your skills. 01.Set Mastery Goals: Define mastery-level goals that challenge your existing abilities and push you to excel even further in this skill.<br><br>02.Continuous Learning: Stay updated with the latest advancements, trends, and best practices in your area of expertise. Seek out advanced courses or workshops to broaden your knowledge.<br><br>03.Mentorship: Consider finding a mentor or expert in your field who can provide guidance, insights, and constructive feedback to help you reach your full potential.<br><br>04.Teaching Others: One of the best ways to solidify your own skills is to teach others. Consider mentoring or sharing your knowledge with those who are less experienced.<br><br>05.Professional Networks: Join professional networks or organizations related to your skill to connect with peers and stay engaged in discussions and activities.<br><br>06.Innovation: Explore ways to innovate within your field, as this can lead to groundbreaking discoveries or improvements.<br><br>', 'promt 54'),
(5, 5, 'skills', 'Great!  You are on track with your skills. 01. Mentorship and Sharing: Consider becoming a mentor to others who are aspiring to reach your level of proficiency. Sharing your knowledge and experience can be highly rewarding.<br><br>02. Staying at the Cutting Edge: Continue staying updated with the latest developments, trends, and emerging technologies in your field. Innovate and pioneer where possible.<br><br>03. Research and Publications: If applicable, consider engaging in research and publishing your findings to contribute to the body of knowledge in your area.<br><br>04. Professional Leadership: Explore leadership opportunities within your industry or professional organizations. Your expertise can be valuable in guiding others.<br><br>05. Networking: Maintain and expand your professional network to collaborate with like-minded experts and stay engaged in discussions and collaborations.<br><br>06. Giving Back: Consider giving back to your community or industry through volunteer work, education, or projects that have a positive impact.', 'promt 55'),
(4, 1, 'skills', 'It sounds like you have some problems with cooperation skills, Please contact  your school counselor for  training/development. 01. Set Clear Goals: Define specific goals for what you want to achieve with this skill. Having clear objectives will provide you with a sense of direction.<br>02. Gather Learning Resources: Seek out educational materials such as courses, tutorials, books, or online resources to gain a foundational understanding of the skill.<br>03. Regular Practice: Consistency is key to skill development. Dedicate time each day or week to practice and apply what you\'ve learned.<br>04. Seek Feedback: Don\'t hesitate to ask for feedback from experienced individuals or mentors in the field. Constructive criticism can help you identify areas that need attention.<br>05. Track Your Progress: Keep a journal or use tools to monitor your progress. This will help you visualize your growth over time.<br>06. Stay Patient and Persistent: Skill development takes time and effort. Be patient with yourself and stay committed, even when faced with challenges.<br>', 'promt 56');
