c Study Goals:<br>Set achievable study goals and break tasks into smaller, manageable steps. Celebrate your progress, and don\'t be too hard on yourself if you don\'t meet all your goals immediately.<br>10. Cultivate a Supportive Environment:<br>Surround yourself with supportive and understanding people. Seek out friends or study groups that promote a positive and encouraging atmosphere.<br>11. Practice Gratitude:<br>Cultivate a mindset of gratitude. Regularly acknowledge and appreciate positive aspects of your life. Gratitude can shift your focus from what\'s lacking to what you have.<br>12. Stay Persistent and Patient:<br>Improving your wellbeing and study process takes time and effort. Stay persistent, be patient with yourself, and acknowledge every small step forward.<br>Remember, it\'s okay to ask for help and take things one step at a time. Your wellbeing is a priority, and with the right support and self-care, you can improve both your mental health and study habits.<br><br><br><br><br>', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 1 out of 5 while, comparing to target group where average was 3 out of 5'),
(3, 2, 'wellbeing', 'Certainly, improving your study process and overall well-being can have a significant impact on your academic performance and overall life satisfaction. Here\'s tailored advice based on the information you provided about your well-being score being lower than the target group\'s average:<br><br>1. Self-Reflection:<br>Reflect on the specific aspects of your well-being that need improvement. Is it stress, lack of sleep, social isolation, or something else? Understanding the root causes is crucial.<br>2. Set Realistic Goals:<br>Set achievable goals to improve your well-being gradually. Small, consistent steps are more effective than attempting drastic changes overnight.<br>3. Time Management:<br>Plan your study time effectively. Create a schedule that allows for regular breaks. Avoid cramming and prioritize consistency over intensity.<br>4. Healthy Lifestyle:<br>Prioritize sleep, exercise, and nutrition. These factors significantly impact your mental and physical well-being, which, in turn, affects your study performance.<br>5. Mindfulness and Relaxation:<br>Practice mindfulness, meditation, or yoga to reduce stress and improve focus. Even dedicating 10-15 minutes a day can make a difference.<br>6. Social Connections:<br>Build a support network. Connect with classmates, join study groups, or talk to a mentor. Social connections can provide emotional support and valuable study resources.<br>7. Seek Help:<br>Dont hesitate to seek help if youre feeling overwhelmed. Talk to teachers, counselors, or mental health professionals. Universities often have support services for students.<br>8. Learning Techniques:<br>Explore various study techniques. Experiment with active learning, flashcards, teaching concepts to others, or using educational apps. Find what works best for you.<br>9. Feedback and Adaptation:<br>Regularly assess your progress. If something isnt working, be willing to adapt your strategies. Learn from both successes and failures.<br>10. Celebrate Progress:<br>Acknowledge and celebrate your achievements, no matter how small. Positive reinforcement boosts motivation and overall well-being.<br>11. Balanced Perspective:<br>Remember that grades dont define your worth. While studying is important, so is your well-being. Balance your academic pursuits with activities that bring you joy.<br>12. Continuous Self-Care:<br>Well-being is an ongoing process. Keep nurturing your physical and mental health. Dont neglect self-care during busy periods.<br>13. Supportive Environment:<br>Surround yourself with positive influences. Avoid toxic relationships and environments that negatively impact your well-being.<br>14. Professional Help:<br>If your well-being struggles persist, consider professional therapy. Mental health professionals can provide tailored strategies to cope with stress and anxiety.<br>Remember, everyones journey is unique. What works for others might not work exactly the same way for you. Be patient with yourself, stay persistent, and focus on progress rather than perfection. Your well-being is the foundation upon which successful studying is built.', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 2 out of 5 while, comparing to target group where average was 3 out of 5'),
(3, 3, 'wellbeing', 'Certainly! If your well-being score is similar to the target group\'s average, it indicates that you\'re on par with your peers in terms of well-being. Here are some personalized study tips to help you maintain and enhance your well-being while studying:<br><br>1. Maintain a Balanced Routine:<br>Stick to a consistent study schedule, allowing for ample breaks and leisure time. Balance academic commitments with social activities, hobbies, and exercise.<br>2. Stay Organized:<br>Keep track of assignments, deadlines, and important dates. An organized approach reduces stress and ensures you manage your time effectively.<br>3. Healthy Lifestyle Choices:<br>Continue prioritizing a healthy diet, regular exercise, and sufficient sleep. These habits not only boost your physical health but also enhance your cognitive abilities and overall well-being.<br>4. Effective Study Techniques:<br>Explore different study methods and find what works best for you. Active learning, summarizing information in your own words, and teaching concepts to others can reinforce your understanding.<br>5. Mindfulness and Relaxation:<br>Practice relaxation techniques such as meditation or deep breathing to manage stress and maintain focus. Even a few minutes of mindfulness can have a positive impact on your well-being.<br>6. Social Connections:<br>Continue nurturing positive relationships with friends and classmates. Engage in group study sessions or participate in social events to maintain a supportive social network.<br>7. Seek Feedback:<br>Request feedback on your academic performance from professors or mentors. Constructive criticism can help you identify areas for improvement and enhance your skills.<br>8. Set Realistic Goals:<br>Establish achievable academic goals and break them down into smaller tasks. Celebrate your accomplishments, and dont be too hard on yourself if you face challenges.<br>9. Variety in Learning:<br>Explore diverse subjects and extracurricular activities. A well-rounded education can keep your studies engaging and contribute to your overall satisfaction.<br>10. Self-Care:<br>Prioritize self-care activities that bring you joy, whether it\'s reading, painting, listening to music, or spending time in nature. Balancing study with enjoyable activities is essential for well-being.<br>11. Continuous Learning:<br>Cultivate a growth mindset. Embrace challenges and view failures as opportunities to learn. Continuous learning enhances your confidence and well-being.<br>12. Help Others:<br>Engage in volunteer work or help classmates with their studies. Acts of kindness and altruism can boost your sense of fulfillment and well-being.<br>13. Stay Connected with Support Systems:<br>Maintain open communication with your friends, family, or a mentor. Sharing your experiences and concerns can provide emotional support and perspective.<br>14. Stay Positive:<br>Cultivate a positive mindset. Focus on your strengths and achievements, and practice gratitude. Positive thinking can significantly impact your overall well-being.<br>Remember, well-being is not a destination but a continuous journey. Keep assessing your feelings and adjusting your strategies as needed. By maintaining a healthy balance between your academic pursuits and personal well-being, you\'ll be well-equipped to navigate the challenges of student life successfully.', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 3 out of 5 while, comparing to target group where average was 3 out of 5'),
(3, 4, 'wellbeing', 'Congratulations on your high well-being score! Having a well-being average of 4 out of 5 indicates that you are doing well and feeling positive about your life. Here are some personalized study tips to help you maintain and further enhance your well-being while studying:<br><br>1. Maintain Balance:<br>Continue balancing your academic commitments with social activities, hobbies, and relaxation. Prioritize self-care and ensure you allocate time for activities that bring you joy and fulfillment.<br>2. Effective Time Management:<br>Keep refining your time management skills. Plan your study sessions efficiently, set realistic goals, and stay organized to maximize productivity while minimizing stress.<br>3. Stay Engaged:<br>Stay actively engaged in your studies by participating in class discussions, asking questions, and seeking challenging academic opportunities. Active engagement enhances your learning experience and overall satisfaction.<br>4. Explore Interests:<br>Explore new subjects or hobbies that pique your interest. Learning about diverse topics can broaden your horizons and contribute to your overall sense of fulfillment.<br>5. Healthy Habits:<br>Continue prioritizing your physical health with regular exercise, a balanced diet, and sufficient sleep. These habits not only maintain your well-being but also provide you with the energy needed for effective studying.<br>6. Mindfulness and Stress Management:<br>Practice mindfulness and stress-reduction techniques regularly, even if you\'re feeling well. These practices can help you manage challenges effectively and maintain your positive outlook.<br>7. Peer Collaboration:<br>Collaborate with your peers on group projects or study sessions. Engaging with others intellectually can provide a sense of community and enhance your learning experience.<br>8. Set Ambitious Goals:<br>Set ambitious yet achievable academic and personal goals. Your high well-being score indicates that you are in a good state to challenge yourself and aim for significant accomplishments.<br>9. Mentorship and Networking:<br>Seek mentorship from professors or professionals in your field of interest. Building professional relationships can provide valuable guidance and enrich your overall college experience.<br>10. Reflect and Appreciate:<br>Regularly reflect on your achievements and express gratitude for the positive aspects of your life, including your education. Appreciating your progress can enhance your overall sense of well-being.<br>11. Stay Open-Minded:<br>Stay open to new experiences and perspectives. Embrace challenges and view them as opportunities for growth. A positive attitude towards learning can further elevate your well-being.<br>12. Practice Empathy:<br>Practice empathy and kindness toward others. Engaging in acts of kindness can boost your own happiness and well-being.<br>13. Sustain Support Systems:<br>Continue nurturing your social relationships and support systems. Positive social connections are vital for maintaining high levels of well-being.<br>14. Stay Proactive:<br>Regularly assess your well-being and academic satisfaction. If you notice any decline, take proactive steps to address the issues, whether it\'s seeking support from friends, family, or counselors.<br>Remember that your well-being is valuable. Continue to invest in it, and your positive approach to life will serve as a strong foundation for your academic and personal success. Enjoy your learning journey!', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 4 out of 5 while, comparing to target group where average was 3 out of 5'),
(3, 5, 'wellbeing', 'It\'s fantastic to hear that you have such a high well-being score! Maintaining a 5 out of 5 score indicates that you have a strong sense of fulfillment and satisfaction in various aspects of your life. Here are some tailored study tips to help you continue your successful academic journey while preserving your excellent well-being:<br><br>1. Maintain a Healthy Balance:<br>Continue balancing your academic pursuits with social activities, hobbies, and relaxation. Prioritize your well-being and ensure you have time for activities that bring you joy and peace.<br>2. Enhanced Focus and Engagement:<br>Channel your high well-being into your studies. Your positive mindset can enhance your focus, creativity, and ability to absorb new information.<br>3. Continuous Growth:<br>Stay intellectually curious. Explore advanced topics, attend seminars, and engage in discussions beyond your curriculum. Continuous learning contributes to your overall fulfillment.<br>4. Leadership and Mentorship:<br>Consider taking on leadership roles in student organizations or clubs. Mentoring others and contributing to your community can provide a deep sense of purpose and fulfillment.<br>5. Healthy Habits:<br>Continue prioritizing your physical health with regular exercise, a balanced diet, and sufficient sleep. These habits not only maintain your well-being but also provide you with the energy needed for your academic pursuits.<br>6. Mindfulness and Stress Management:<br>Practice mindfulness and stress-reduction techniques regularly. Even with high well-being, these practices can act as preventive measures, ensuring you stay resilient during challenging times.<br>7. Research and Innovation:<br>Consider engaging in research projects or innovation challenges. Applying your knowledge to real-world problems can be incredibly rewarding and intellectually stimulating.<br>8. Networking and Global Perspective:<br>Build a professional network. Engage with professors, alumni, and professionals in your field. Consider studying abroad or participating in international programs to gain a global perspective.<br>9. Self-Reflection and Gratitude:<br>Regularly reflect on your achievements and express gratitude for the opportunities you have. Gratitude enhances your overall sense of well-being and contentment.<br>10. Embrace Challenges:<br>Embrace challenging academic projects or internships. Overcoming obstacles and pushing your boundaries can lead to a profound sense of accomplishment and satisfaction.<br>11. Foster Positive Relationships:<br>Continue nurturing positive relationships with friends, family, and mentors. Meaningful connections contribute significantly to your overall well-being.<br>12. Plan for the Future:<br>Set long-term goals and create a roadmap for your future. Having a sense of purpose and direction can further enhance your overall life satisfaction.<br>13. Stay Open to Learning:<br>Stay open-minded and humble in your academic journey. There\'s always something new to learn, and every experience, no matter how small, can enrich your life.<br>14. Give Back to the Community:<br>Engage in volunteer work or community service. Giving back not only helps others but also provides a deep sense of fulfillment and purpose.<br>Remember that your well-being is a precious asset. By continuing to balance your academic pursuits with self-care and meaningful experiences, you can enjoy a fulfilling and successful student life while maintaining your high level of well-being. Keep thriving!<br><br><br><br><br><br>', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 5 out of 5 while, comparing to target group where average was 3 out of 5'),
(2, 1, 'wellbeing', '<br>I\'m sorry to hear that your well-being score is lower than the target group\'s average. It\'s important to prioritize your well-being while improving your study process. Here are some tailored study tips to help you enhance your well-being and academic performance:<br><br>1. Seek Support:<br>Reach out to friends, family, or a counselor to talk about your feelings. Having a support system can provide emotional relief and perspective.<br>2. Professional Help:<br>Consider talking to a mental health professional, therapist, or counselor. They can provide expert guidance tailored to your specific situation.<br>3. Break Tasks into Smaller Steps:<br>Break your study tasks into smaller, manageable chunks. This can make studying feel less overwhelming and more achievable.<br>4. Set Realistic Goals:<br>Set small, achievable goals for your studies. Celebrate your progress, no matter how minor it may seem. Success, no matter how small, can boost your confidence and well-being.<br>5. Time Management:<br>Improve your time management skills. Create a study schedule that includes breaks. Use techniques like the Pomodoro method (25 minutes of focused study followed by a 5-minute break) to maintain concentration.<br>6. Healthy Lifestyle Choices:<br>Prioritize your physical health. Exercise regularly, maintain a balanced diet, and ensure you\'re getting enough sleep. Physical well-being significantly impacts mental health.<br>7. Mindfulness and Relaxation Techniques:<br>Practice mindfulness, meditation, or deep breathing exercises. These techniques can help reduce stress and improve focus.<br>8. Positive Reinforcement:<br>Practice positive self-talk. Replace negative thoughts with positive affirmations. Remind yourself of your strengths and achievements.<br>9. Limit Distractions:<br>Create a conducive study environment. Minimize distractions such as social media, noisy surroundings, or clutter. A focused study space can enhance concentration.<br>10. Study Groups and Peer Support:<br>Consider joining study groups. Interacting with peers who are motivated can provide a supportive learning environment.<br>11. Learn Study Strategies:<br>Research and employ effective study techniques. Active learning methods, summarizing information, and teaching concepts to others can enhance your understanding and retention.<br>12. Practice Self-Care:<br>Engage in activities you enjoy outside of studying. Whether it\'s reading, art, music, or nature walks, these activities can provide emotional relief and relaxation.<br>13. Celebrate Progress:<br>Acknowledge and celebrate your achievements, no matter how small. Reward yourself for completing tasks or reaching milestones. Positive reinforcement can boost motivation.<br>14. Persevere and Be Patient:<br>Improving your well-being and study habits is a gradual process. Be patient with yourself, and dont be too hard on yourself if progress seems slow. Every step forward is a victory.<br>Remember, it\'s okay to ask for help, and your well-being matters. By implementing these strategies and seeking the support you need, you can gradually improve both your well-being and your academic performance.', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 1 out of 5 while, comparing to target group where average was 2 out of 5'),
(2, 2, 'wellbeing', 'Improving your well-being and study process is a journey that requires patience, self-compassion, and dedication. Here are some personalized study tips to help you enhance your well-being and academic performance, considering your current well-being score compared to the target group:<br><br>1. Self-Reflection and Goal Setting:<br>Reflect on the specific aspects of your well-being that need improvement. Set realistic, achievable goals for both your well-being and academic progress.<br>2. Seek Support:<br>Reach out to friends, family, or counselors to talk about your feelings. Building a support network is crucial for emotional well-being.<br>3. Professional Help:<br>Consider speaking with a mental health professional who can provide tailored guidance to improve your well-being.<br>4. Structured Study Plan:<br>Create a detailed study plan that outlines what you need to study, when, and for how long. Having a structured plan can reduce anxiety and provide a clear direction.<br>5. Effective Time Management:<br>Manage your time effectively by breaking tasks into smaller, manageable chunks. Use time management techniques like the Pomodoro method to maintain focus during study sessions.<br>6. Healthy Lifestyle Choices:<br>Prioritize your physical health. Exercise regularly, maintain a balanced diet, and ensure you get enough sleep. Physical well-being directly impacts mental health and cognitive function.<br>7. Mindfulness and Relaxation Techniques:<br>Practice mindfulness, meditation, or yoga to reduce stress and improve focus. These techniques can enhance your overall well-being and concentration.<br>8. Positive Self-Talk:<br>Challenge negative self-talk and replace it with positive affirmations. Believe in your abilities and celebrate your achievements, no matter how small they might seem.<br>9. Study Environment:<br>Create a comfortable, organized study space. Minimize distractions and surround yourself with motivational quotes or items that inspire you to study.<br>10. Engage Actively in Classes:<br>Actively participate in your classes. Ask questions, engage in discussions, and seek clarification when needed. Active engagement enhances understanding and boosts confidence.<br>11. Variety in Learning:<br>Explore different learning resources. Use textbooks, online courses, videos, and educational apps to diversify your learning experience. Find what works best for you.<br>12. Regular Exercise and Relaxation:<br>Incorporate regular physical activity into your routine. Exercise is a natural stress-reliever and mood enhancer.<br>13. Celebrate Progress:<br>Acknowledge and celebrate your progress regularly. Reward yourself for achieving study goals. Positive reinforcement strengthens motivation.<br>14. Practice Gratitude:<br>Cultivate gratitude by appreciating the positive aspects of your life, including your education. Gratitude can shift your focus from whats lacking to what you have, improving overall well-being.<br>Remember, improving well-being and study habits is a gradual process. Be patient with yourself, stay persistent, and don\'t hesitate to seek help when needed. With dedication and the right support, you can enhance both your well-being and academic success.', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 2 out of 5 while, comparing to target group where average was 2 out of 5'),
(2, 3, 'wellbeing', 'It\'s great to hear that your well-being score is above the target group\'s average. Here are some personalized study tips to help you maintain and further enhance your well-being and academic performance:<br><br>1. Reflect and Appreciate:<br>Reflect on the aspects of your life that contribute to your well-being. Appreciate your strengths, achievements, and positive relationships. Gratitude can enhance your overall satisfaction and motivation.<br>2. Maintain Balance:<br>Continue balancing your academic commitments with social activities, hobbies, and relaxation. Prioritize self-care and ensure you allocate time for activities that bring you joy and relaxation.<br>3. Effective Study Strategies:<br>Identify and utilize study techniques that work best for you. Active learning, summarizing information, and teaching concepts to others are effective methods to enhance understanding and retention.<br>4. Time Management:<br>Continue managing your time effectively. Create a study schedule that includes breaks for relaxation and leisure. Use techniques like the Pomodoro method to maintain focus during study sessions.<br>5. Healthy Lifestyle Choices:<br>Prioritize your physical health with regular exercise, a balanced diet, and sufficient sleep. Physical well-being significantly impacts mental clarity and focus.<br>6. Mindfulness and Relaxation:<br>Practice mindfulness, meditation, or yoga regularly. These practices can reduce stress, enhance concentration, and promote overall well-being.<br>7. Social Connections:<br>Nurture positive relationships with friends, family, and classmates. Engage in group study sessions or participate in social activities to maintain a supportive social network.<br>8. Continuous Learning:<br>Stay intellectually curious. Explore topics beyond your curriculum, attend seminars, or engage in online courses. Lifelong learning enriches your perspective and adds to your sense of fulfillment.<br>9. Set Challenging Goals:<br>Set challenging yet achievable academic goals. Pursuing goals that align with your interests and passions can provide a sense of purpose and accomplishment.<br>10. Positive Mindset:<br>Cultivate a positive mindset. Believe in your abilities and approach challenges as opportunities for growth. Positive thinking can enhance your resilience and overall well-being.<br>11. Effective Communication:<br>Develop your communication skills. Effective communication with peers and professors can enhance your learning experience and create positive relationships.<br>12. Reflective Practice:<br>Reflect on your study sessions. What worked well? What could be improved? Regular self-reflection can help you identify areas for growth and make necessary adjustments.<br>13. Engage in Extracurricular Activities:<br>Participate in extracurricular activities that align with your interests. Involvement in clubs, sports, or volunteer work can provide a sense of belonging and fulfillment.<br>14. Celebrate Achievements:<br>Acknowledge and celebrate your academic achievements, no matter how small. Reward yourself for reaching milestones. Celebrating progress reinforces your motivation and positive outlook.<br>Remember, your well-being is a valuable asset. By maintaining a healthy balance between your academic pursuits and personal well-being, you are well-positioned for continued success and fulfillment. Keep nurturing your well-being and enjoy your learning journey!', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 3 out of 5 while, comparing to target group where average was 2 out of 5'),
(2, 4, 'wellbeing', 'Congratulations on your high well-being score! Having a well-being average of 4 out of 5 indicates that you are in a positive and content state. Here are some personalized study tips to help you maintain and further enhance your well-being and academic performance:<br><br>1. Maintain a Healthy Balance:<br>Continue balancing your academic commitments with social activities, hobbies, and relaxation. Prioritize self-care and ensure you allocate time for activities that bring you joy and relaxation.<br>2. Effective Study Strategies:<br>Identify and utilize study techniques that work best for you. Active learning, summarizing information, and teaching concepts to others are effective methods to enhance understanding and retention.<br>3. Time Management and Organization:<br>Continue managing your time effectively. Create a study schedule that allows for regular breaks and leisure time. Use tools like planners and apps to stay organized and on top of your assignments.<br>4. Engage in Active Learning:<br>Actively participate in your classes. Ask questions, engage in discussions, and seek out additional learning resources. Active engagement enhances understanding and boosts confidence.<br>5. Healthy Lifestyle Choices:<br>Prioritize your physical health with regular exercise, a balanced diet, and sufficient sleep. Exercise not only keeps you physically fit but also enhances mental clarity and focus.<br>6. Mindfulness and Relaxation:<br>Continue practicing mindfulness, meditation, or yoga regularly. These practices can reduce stress, enhance concentration, and promote overall well-being.<br>7. Social Connections:<br>Nurture positive relationships with friends, family, and classmates. Engage in group study sessions or participate in social activities to maintain a supportive social network.<br>8. Continuous Learning:<br>Stay intellectually curious. Explore topics beyond your curriculum, attend seminars, or engage in online courses. Lifelong learning enriches your perspective and adds to your sense of fulfillment.<br>9. Set Ambitious Goals:<br>Set challenging yet achievable academic and personal goals. Pursue projects and activities that align with your passions. Setting and achieving goals adds purpose to your studies.<br>10. Positive Mindset:<br>Cultivate a positive mindset. Approach challenges as opportunities for growth and learning. Positive thinking can enhance your resilience and overall well-being.<br>11. Effective Communication:<br>Develop your communication skills. Clear communication with peers and professors can enhance your learning experience and create positive relationships.<br>12. Reflective Practice:<br>Reflect on your study sessions. What worked well? What could be improved? Regular self-reflection can help you identify areas for growth and make necessary adjustments.<br>13. Engage in Extracurricular Activities:<br>Participate in extracurricular activities that align with your interests. Involvement in clubs, sports, or volunteer work can provide a sense of belonging and fulfillment.<br>14. Share Your Knowledge:<br>Consider tutoring or mentoring others. Sharing your knowledge not only helps others but also reinforces your understanding and boosts your confidence.<br>Remember, maintaining a positive well-being is a continuous journey. By combining your positive mindset with effective study habits, you are well-equipped to excel academically while enjoying a fulfilling and enriching college experience. Keep nurturing your well-being and continue to thrive!<br><br><br><br><br><br>', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 4 out of 5 while, comparing to target group where average was 2 out of 5'),
(2, 5, 'wellbeing', 'Congratulations on your exceptional well-being score! Your positive mindset and contentment can greatly enhance your study process. Here are some tailored study tips to help you make the most out of your academic journey:<br><br>1. Maintain a Healthy Balance:<br>Continue balancing your academic responsibilities with social activities, hobbies, and relaxation. Your positive well-being is an asset; use it to maintain a balanced lifestyle.<br>2. Effective Study Strategies:<br>Focus on refining your study techniques. Experiment with active learning, group discussions, teaching concepts to others, and diverse educational resources. Your positive attitude will enhance the effectiveness of these methods.<br>3. Time Management Mastery:<br>Hone your time management skills. Create a study schedule that includes regular breaks and leisure time. Utilize time management techniques to stay organized and efficient.<br>4. Engage Actively in Classes:<br>Actively participate in lectures and discussions. Your positive attitude can inspire others and create a constructive learning atmosphere.<br>5. Pursue Passion Projects:<br>Explore subjects or projects that genuinely excite you. Your enthusiasm will fuel your learning, making the process more engaging and rewarding.<br>6. Embrace Challenges:<br>Welcome challenging academic endeavors. Your positive mindset equips you to approach difficulties as opportunities for growth. Overcoming challenges can be deeply fulfilling.<br>7. Continuous Learning and Curiosity:<br>Cultivate your curiosity. Explore topics beyond your curriculum, attend seminars, and engage in discussions. Your positive attitude will make your quest for knowledge even more enriching.<br>8. Mentorship and Leadership:<br>Consider mentoring or tutoring others. Your positive energy can motivate and inspire fellow students. Additionally, leadership roles in student organizations can provide a sense of purpose.<br>9. Positive Mindset and Visualization:<br>Maintain your positive mindset. Visualize your success and believe in your abilities. Positive self-talk enhances confidence and resilience during challenging times.<br>10. Effective Communication:<br>Develop your communication skills further. Clear and positive communication fosters better understanding and collaboration among peers and professors.<br>11. Reflective Practice:<br>Regularly reflect on your learning journey. Celebrate your achievements and acknowledge your progress. Reflective practice reinforces your positive outlook and self-awareness.<br>12. Gratitude and Appreciation:<br>Practice gratitude daily. Appreciate your education, opportunities, and the people around you. Gratitude deepens your positive emotions and enriches your overall experience.<br>13. Creative Expression:<br>Engage in creative activities. Writing, drawing, music, or any form of artistic expression can provide a positive outlet for your emotions and enhance your overall well-being.<br>14. Help Others:<br>Use your positive energy to help others. Volunteer, assist classmates, or engage in community service. Acts of kindness contribute to your positive well-being and create a positive impact on others.<br>Remember, your positive well-being is not just a personal achievement but also a gift that you can share with the world. Your positive attitude and contentment will not only enrich your academic experience but also inspire those around you. Keep shining and continue embracing your journey with enthusiasm and positivity!', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 5 out of 5 while, comparing to target group where average was 2 out of 5'),
(1, 1, 'wellbeing', 'Improving your overall wellbeing while studying is crucial for both your mental and physical health. Here are some personalized pieces of advice based on your feedback, aiming to enhance your wellbeing:<br><br>1. Prioritize Self-Care:<br>Allocate time for activities you enjoy, whether it\'s reading, painting, or spending time with friends. Regularly engage in hobbies that bring you joy.<br>2. Mindful Breathing and Relaxation:<br>Practice deep breathing or meditation to manage stress. Apps like Headspace or Calm can guide you through short, effective mindfulness exercises.<br>3. Physical Activity:<br>Incorporate physical activity into your routine. Even short, daily walks can boost your mood and energy levels. Exercise is a proven stress-reliever.<br>4. Healthy Eating Habits:<br>Maintain a balanced diet. Avoid excessive caffeine and sugar; opt for nutritious meals and stay hydrated. Proper nutrition can significantly impact your mood and energy.<br>5. Quality Sleep:<br>Prioritize sleep. Create a relaxing bedtime routine and ensure you\'re getting 7-9 hours of sleep each night. Quality rest is essential for cognitive function and emotional wellbeing.<br>6. Social Support:<br>Connect with friends and family regularly. Social support is crucial for mental health. Dont hesitate to talk about your feelings with someone you trust.<br>7. Time Management:<br>Organize your schedule effectively to reduce feelings of being overwhelmed. Prioritize tasks and break them into manageable chunks. Dont be afraid to delegate when possible.<br>8. Professional Help:<br>If your feelings of distress persist, consider talking to a mental health professional. Therapy or counseling can provide coping strategies tailored to your situation.<br>9. Gratitude Practice:<br>Cultivate a gratitude habit. Regularly reflect on things you\'re thankful for; this practice can shift your focus from negatives to positives.<br>10. Limit Social Media:<br>Limit your time on social media. Comparing yourself to others online can lead to negative feelings. Instead, focus on your own progress and achievements.<br>11. Set Realistic Expectations:<br>Be kind to yourself. Set realistic goals and acknowledge your accomplishments, no matter how small they might seem. Celebrate your progress.<br>12. Learn to Say No:<br>Dont overburden yourself with too many commitments. Learn to say no to additional responsibilities if youre already feeling overwhelmed.<br>Remember, your wellbeing is paramount. It\'s not just a byproduct of success; it\'s the foundation upon which your achievements are built. By incorporating these practices into your daily life, you can enhance your overall sense of wellbeing and create a healthier, happier study environment for yourself.', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 1 out of 5 while, comparing to target group where average was 1 out of 5'),
(1, 2, 'wellbeing', 'Improving your well-being and study process is a worthy endeavor. Here are some personalized study tips to help you enhance your well-being and academic performance, considering your current well-being score compared to the target group:<br><br>1. Prioritize Self-Care:<br>Start by focusing on self-care. Ensure you\'re getting enough sleep, maintaining a balanced diet, and engaging in regular physical activity. Physical well-being is the foundation for mental well-being.<br>2. Set Clear Goals:<br>Define clear academic and personal goals. Knowing what you want to achieve will give your studies more purpose and motivation.<br>3. Effective Time Management:<br>Learn effective time management skills. Create a study schedule that includes dedicated study sessions and breaks. Tools like calendars and to-do lists can help you stay organized.<br>4. Stress Management:<br>Develop stress management techniques. Practice relaxation exercises, mindfulness, or deep breathing to reduce anxiety and improve focus.<br>5. Positive Mindset:<br>Cultivate a positive mindset. Challenge negative self-talk and focus on your strengths. Believing in your abilities can boost your confidence.<br>6. Study Strategies:<br>Explore different study techniques to find what works best for you. Active learning, summarizing information, and teaching concepts to others can be effective.<br>7. Seek Support:<br>Don\'t hesitate to seek support from professors, tutors, or academic advisors when needed. They can provide guidance and resources to help you succeed.<br>8. Join Study Groups:<br>Consider joining or forming study groups with classmates. Collaborative learning can provide a sense of community and additional study resources.<br>9. Balanced Routine:<br>Maintain a balanced routine that includes time for leisure, hobbies, and social activities. A well-rounded life contributes to your overall well-being.<br>10. Continuous Learning:<br>Stay curious and open to new knowledge. Explore subjects beyond your coursework and attend seminars or workshops to broaden your horizons.<br>11. Reflect and Adapt:<br>Regularly assess your study methods and progress. Be willing to adapt your strategies if something isn\'t working. Learning from your experiences is crucial.<br>12. Social Connections:<br>Cultivate positive relationships with peers and engage in social activities. Building a support network can provide emotional support and a sense of belonging.<br>13. Celebrate Achievements:<br>Acknowledge and celebrate your accomplishments, no matter how small they may seem. Recognizing your progress can boost motivation and self-esteem.<br>14. Gratitude Practice:<br>Practice gratitude by acknowledging the positive aspects of your life, including your education. Gratitude can shift your focus toward what\'s going well and improve your overall well-being.<br>Remember, improving well-being and study habits is a gradual process. Be patient with yourself and take small steps toward positive changes. Over time, these adjustments can lead to significant improvements in both your well-being and academic performance.', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 2 out of 5 while, comparing to target group where average was 1 out of 5        '),
(1, 3, 'wellbeing', 'Certainly! Having a well-being score above the target group\'s average indicates that you\'re in a relatively good state. Here are some tailored study tips to help you maintain and enhance your well-being while optimizing your study process:<br><br>1. Reflect on Strengths:<br>Reflect on the aspects of your life that contribute to your well-being. Identify your strengths and positive qualities. Confidence in your abilities can positively influence your studies.<br>2. Effective Study Strategies:<br>Diversify your study methods. Explore active learning, summarization techniques, and teaching concepts to reinforce your understanding. Adapt your strategies based on the subject matter.<br>3. Time Management Mastery:<br>Fine-tune your time management skills. Create a detailed study schedule, allocate specific time slots for each subject, and incorporate regular breaks for relaxation and leisure.<br>4. Mindfulness and Stress Management:<br>Practice mindfulness, meditation, or yoga to manage stress and maintain focus. These techniques can enhance your overall well-being and improve concentration during study sessions.<br>5. Healthy Lifestyle Choices:<br>Prioritize your physical health with regular exercise, a balanced diet, and sufficient sleep. Exercise not only boosts your energy levels but also improves your mood and cognitive function.<br>6. Social Connections:<br>Cultivate positive relationships with friends, family, and classmates. Engage in group study sessions or participate in social activities to maintain a supportive social network.<br>7. Continuous Learning and Curiosity:<br>Cultivate your curiosity. Explore topics beyond your curriculum, attend seminars, and engage in discussions. Lifelong learning enriches your perspective and adds to your sense of fulfillment.<br>8. Set Clear Goals:<br>Set specific, achievable goals for your studies. Break down larger goals into smaller tasks and celebrate your accomplishments. Goal-setting can provide a sense of purpose and motivation.<br>9. Effective Communication:<br>Develop your communication skills. Clear communication with peers and professors enhances your learning experience and fosters positive relationships.<br>10. Reflective Practice:<br>Regularly reflect on your study sessions. What worked well? What could be improved? Self-reflection helps you identify areas for growth and refine your study strategies.<br>11. Balanced Routine:<br>Maintain a balanced routine that includes time for hobbies, relaxation, and social interactions. Balancing your academic pursuits with personal activities contributes to overall well-being.<br>12. Gratitude Practice:<br>Practice gratitude by acknowledging the positive aspects of your life, including your education. Gratitude enhances your overall sense of well-being and contentment.<br>13. Peer Collaboration:<br>Collaborate with classmates on projects or study sessions. Engaging with others intellectually can provide a sense of community and enhance your learning experience.<br>14. Celebrate Progress:<br>Acknowledge and celebrate your academic achievements, no matter how small. Reward yourself for reaching milestones. Celebrating progress reinforces your motivation and positive outlook.<br>Remember, maintaining a positive well-being is a continuous journey. By integrating these strategies into your study routine, you can further enhance your overall well-being and academic success. Keep up the good work!', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 3 out of 5 while, comparing to target group where average was 1 out of 5        ');
INSERT INTO `response` (`average`, `personal`, `type`, `response`, `promt`) VALUES
(1, 4, 'wellbeing', 'Having a well-being score significantly higher than the target group\'s average is a testament to your positive mindset and contentment. Here are some tailored study tips to help you maintain and maximize your well-being while optimizing your study process:<br><br>1. Leverage Your Positive Mindset:<br>Use your positive attitude to your advantage. Embrace challenges as opportunities for growth. Your optimistic outlook will help you tackle difficult subjects with confidence.<br>2. Effective Study Strategies:<br>Explore advanced study techniques such as active learning, teaching concepts to others, and interdisciplinary learning. Your positive mindset enhances your ability to absorb and apply complex information.<br>3. Efficient Time Management:<br>Refine your time management skills. Optimize your study schedule, breaking down tasks into manageable chunks. Allocate time for in-depth understanding and creative exploration within your subjects.<br>4. Mindfulness and Stress Management:<br>Continue practicing mindfulness and relaxation techniques. Even with a high well-being score, these practices ensure you maintain balance during intense study periods.<br>5. Healthy Lifestyle Choices:<br>Prioritize your physical health with regular exercise, a balanced diet, and ample rest. Healthy habits sustain your energy levels and mental clarity, ensuring effective study sessions.<br>6. Engage in Diverse Learning Experiences:<br>Pursue diverse interests and subjects. Engaging in a wide range of topics not only enriches your knowledge but also enhances your overall well-being and intellectual satisfaction.<br>7. Networking and Collaboration:<br>Build a strong professional network. Engage with professors, attend seminars, and collaborate with fellow students on projects. Meaningful connections contribute to your intellectual fulfillment.<br>8. Set Ambitious Goals:<br>Set ambitious yet achievable academic and personal goals. Your positive mindset provides the motivation and confidence needed to pursue challenging objectives.<br>9. Effective Communication:<br>Hone your communication skills. Clear and articulate communication can enhance your interactions with peers, professors, and potential employers, enriching your academic experience.<br>10. Continuous Self-Reflection:<br>Continuously reflect on your learning journey. Regular self-assessment ensures that you remain aligned with your goals and passions, fostering a sense of purpose and fulfillment.<br>11. Gratitude and Appreciation:<br>Practice gratitude daily. Appreciate your education, experiences, and the people around you. Gratitude deepens your positive emotions and enriches your overall well-being.<br>12. Balanced Routine:<br>Maintain a balanced routine that includes time for academic pursuits, hobbies, social interactions, and relaxation. Balance ensures holistic development and satisfaction.<br>13. Mentorship and Giving Back:<br>Consider mentoring others or volunteering. Sharing your knowledge and expertise not only helps others but also reinforces your own understanding and provides a sense of fulfillment.<br>14. Celebrate Achievements:<br>Acknowledge and celebrate your academic and personal achievements. Regularly appreciating your progress reinforces your positive mindset and motivates further accomplishments.<br>With your high well-being score as a foundation, you are well-equipped to excel academically and make the most out of your learning journey. Keep nurturing your positive mindset and embracing new challenges with enthusiasm and confidence. Your optimistic approach will continue to fuel your success.', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 4 out of 5 while, comparing to target group where average was 1 out of 5        '),
(1, 5, 'wellbeing', 'Congratulations on your outstanding well-being score! Your positive mindset and contentment are valuable assets that can greatly enhance your study process. Here are some tailored study tips to help you make the most out of your academic journey while maintaining your excellent well-being:<br><br>1. Channel Your Positivity:<br>Use your positive mindset as a foundation for your studies. Approach challenges with confidence, knowing that your optimistic outlook can help you find creative solutions.<br>2. Deepen Your Learning:<br>Dive deeper into your subjects of interest. Explore advanced topics, engage in discussions, and seek out additional resources. Your enthusiasm will drive your passion for learning.<br>3. Effective Time Management:<br>Optimize your time management skills. Create a study schedule that allows for in-depth exploration and regular breaks. Use techniques like the Pomodoro method to maintain focus and productivity.<br>4. Holistic Development:<br>Balance your academic pursuits with personal growth. Engage in hobbies, sports, arts, or volunteering. Well-rounded experiences contribute to your overall well-being and intellectual fulfillment.<br>5. Embrace Leadership Opportunities:<br>Consider taking on leadership roles in student organizations or projects. Your positive attitude can inspire and motivate others, creating a vibrant and supportive community.<br>6. Networking and Mentorship:<br>Build a strong professional network. Connect with professors, alumni, and industry professionals. Your positive demeanor can make networking interactions more fruitful and enjoyable.<br>7. Innovate and Create:<br>Explore opportunities for innovation and creativity. Projects that allow you to apply your knowledge in unique ways can be incredibly fulfilling and intellectually stimulating.<br>8. Practice Gratitude:<br>Continue practicing gratitude daily. Acknowledge the positive aspects of your education, experiences, and relationships. Gratitude enhances your overall sense of well-being and contentment.<br>9. Effective Communication:<br>Hone your communication skills further. Clear and positive communication fosters better understanding and collaboration among peers and professors.<br>10. Continuous Self-Reflection:<br>Regularly reflect on your learning journey. Celebrate your achievements and identify areas for growth. Self-reflection enhances your personal and academic development.<br>11. Share Your Knowledge:<br>Mentor others or participate in knowledge-sharing initiatives. Your positive energy can inspire and empower fellow students, creating a positive impact in your academic community.<br>12. Explore Interdisciplinary Learning:<br>Venture into interdisciplinary studies. Combining knowledge from different fields can provide unique insights and broaden your perspective.<br>13. Maintain a Healthy Balance:<br>Despite your high well-being, ensure you maintain a healthy balance. Prioritize self-care, relationships, and relaxation. A harmonious life contributes to sustained happiness and success.<br>14. Celebrate Your Journey:<br>Acknowledge every milestone and accomplishment in your academic journey. Celebrate your growth, both academically and personally. Positive reinforcement enhances your motivation and passion for learning.<br>With your exceptional well-being and positive attitude, you are well-positioned to make a significant impact in your academic pursuits and beyond. Keep embracing challenges, nurturing your curiosity, and fostering a positive environment around you. Your positive mindset will continue to be a guiding light on your path to success.', 'Please generate advice for study process for a student who\'s average of responses on wellbeing was 5 out of 5 while, comparing to target group where average was 1 out of 5        ');
